column17:
The second post is an example of using the Distract tactic by including a completely different irrelevant topic in the tweet. Instead of focusing on the topic of the US military, the tweet mentions voting for an artist at the SECAwards.

@demonarmys @secawards I vote #RM for #ArtistaAsiatico at #SECAwards Marcos

This tactic is used to divert attention away from the original topic of discussion and steer the conversation in a different direction. It can be a strategy to avoid addressing or engaging with the main topic at hand.

